import React from "react";
import styled from "styled-components";
import bgImages from '../images/bg.jpg'

function Picture() {
	return (
		<BoxPicture>
			<img src={bgImages} alt={'picture'}/>
		</BoxPicture>
	)
}


const BoxPicture = styled.div`
  width: 280px;
  height: 170px;
  margin: 10px 10px 20px 10px;
  border-radius: 10px;
`
export default Picture;
